const axios = require('axios');

axios.get('https://api.pinata.cloud/pinning/pinJSONToIPFS')
  .then(response => {
    console.log(response.data.url);
    console.log(response.data.explanation);
  })
  .catch(error => {
    console.log(error);
  });

